import LoginRegister from "./LoginRegister";
function LogoutBtn({ isLoggedIn, handleLogout }) {



    return (
        <div>
            <LoginRegister />
            {isLoggedIn ? (
                <li>
                    <button onClick={handleLogout}>Logout</button>
                </li>
            ) : null}
        </div>
    )
};

export default LogoutBtn;
